import React from 'react';
import Button from '@material-ui/core/Button';

function Covid() {
    return (
        <div className="covid-plan">
            <div className="covid-title">
                <h3>სკოლაში არსებული რეგულაციები COVID-19 -ისგან თავის დასაცავად.</h3>
            </div>
            <div className="covid-link">
                <a href="https://fb.watch/4Xzh_CidlG/"><Button variant="contained" color="secondary" style={{width: "200px",height:"100px"}}>იხილეთ აქ</Button></a>
            </div>
        </div>
    )
}

export default Covid;
